/**
 * Enum of label's connector shape location types
 */
export enum ConnectorLocationType {
    /**
     * At 'from' value of component's 'depth' range
     */
    From = 'from',
    /**
     * At the middle of component's 'depth' range
     */
    Center = 'center',
    /**
     * At 'to' value of component's 'depth' range
     */
    To = 'to'
}
